import React from 'react';
import PropTypes from 'prop-types';
import Head from 'next/head';
import 'antd/dist/antd.css';


const App = ({ Component }) => {
  return (
    <>
      <Head>
        <meta name="Description" content="earth-bird" />
      </Head>
      <Component />
    </>
  )
}

App.prototype = {
  Component: PropTypes.elementType.isRequired
}

 export default App;
